import {Grid, Table, TableCell, TableHead, TableRow} from "@material-ui/core";
import HeaderMenu from "../components/HeaderMenu";
import {connect} from "react-redux";
import React, {useEffect} from "react";
import {get} from "../actions/Status";

const Status = (props) => {
	const {
		get = () => {},
	} = props;

	useEffect(() => get(), [
		get
	]);

	console.log(props);

	return (
		<Grid
			xs={12}
			sm={12}
			lg={12}
			md={12}
			item
			container
		>
			<HeaderMenu history={props.history} />
			<Table>
				<TableHead>
					<TableRow>
						<TableCell>
							ID
						</TableCell>
						<TableCell>
							Name
						</TableCell>
						<TableCell>
							CREATE DATE
						</TableCell>
						<TableCell>
							ACTIONS
						</TableCell>
					</TableRow>
				</TableHead>
			</Table>
		</Grid>
	);
}

const mapStateToProps = state => state.StatusStore;

const mapDispatchToProps = dispatch => ({
	get: () => dispatch(get()),
});

export default connect(mapStateToProps, mapDispatchToProps)(Status);
